import axios from "axios";
import React, { useEffect, useState } from "react";
import { Table } from "reactstrap";
import "../SalesSheetcomponent/SalesSheetCard.css";
import FilterByTicketNumber from "./FilterByTicketNumber";
import JuniperREF from "./JuniperREF";

function SalesSheetCard() {
  const [data, setdata] = useState(null);
  const [err, seterr] = useState(null);

  useEffect(() => {
    axios
      .get("https://puce-enthusiastic-swordfish.cyclic.app/salesB2C")
      .then((Nwedata) => setdata(Nwedata.data))
      .catch((err) => seterr(err));
  }, []);

  return (
    <div className="sales-sheet-card">
      {/* {data && <JuniperREF data={data} />} */}
      <div className="sales-sheet-card-item">
        {data && <FilterByTicketNumber data={data} />}
        <thead>
          <tr>
            <th>#</th>
            <th>Ticket Number</th>
            <th>Agent Name</th>
            <th>Product Type</th>
            <th>Guest Name</th>
            <th>Supplier</th>
            <th>Supplier Category</th>
            <th>Juniper REF</th>
            <th>Supplier Reference</th>
            <th>Check In Date</th>
            <th>Check Out Date</th>
            <th>Voucher Number</th>
            <th>Sales Rate</th>
            <th>Net Rate</th>
            <th>Currency</th>
            <th>Exchange Rate</th>
            <th>Net Rate IN KWD</th>
            <th>Profit</th>
            <th>Remarks</th>
          </tr>
        </thead>
      </div>
    </div>
  );
}

export default SalesSheetCard;
